import ProfileCard from "./ProfileCard";

function ProfileContainer({ currentUser }) {
  console.log(currentUser);
  return (
    <div className="user-container">
      {currentUser.map((user) => (
        <div key={user.id}>
          <ProfileCard user={user} />
        </div>
      ))}
    </div>
  );
}

export default ProfileContainer;
